import React from "react";
import { View, StyleSheet, Text } from "react-native";
import VerifyFloatingButton from "../assets/VerifyFloatingButton";
import MyTabs from "../navigation/BaseNavigationService";

const Mainpage = ({}) => {
  return (
    // Try setting `flexDirection` to `column`.

    <View
      style={{
        flex: 1,
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "space-around",
      }}
    >
      <View
        style={{ width: 50, height: 50, backgroundColor: "powderblue" }}
      ></View>
      <View style={{ width: 75, height: 75, backgroundColor: "skyblue" }}>
        <Text>asfaffafasf</Text>
      </View>
      <VerifyFloatingButton />
    </View>
  );
};

export default Mainpage;
